import React, { useEffect, useState } from "react";
import ResolCSS from '../styles/Resolution.module.css'
import FormCSS from '../styles/Form.module.css'

import { nanoid } from 'nanoid'

import Resolution from "./Resolution";

export default function ResolutionForm() {
    let [dataRes, setDataRes] = useState()

    const getTest = async () => {
        return await fetch('/resolution/:id')
            .then(res => res.json()).then(r => r.data)
    }

    useEffect(() => {
        getTest().then(r => setDataRes(r))
    }, [])
    console.log(dataRes)

    return <form method="post">
        <Resolution />

        <button className={FormCSS.btnAdd} type="submit">Завершить</button>
    </form>
}
